import React from 'react';
import Header from './Header';
import Particles from './Particles';
import './Home.css'

const Home = () => {
  return (
  <div className='bg-orange-400'>
    <Particles />
    <React.Fragment >
      <Header />
      <Particles />
    </React.Fragment>
  </div>

  );
}

export default Home;
